import Icon from '@chakra-ui/icon';
import { Box, HStack , Text, Button, Stack, Tabs, TabList, TabPanels, Tab, TabPanel } from '@chakra-ui/react';
import React from 'react';
import {BiErrorCircle} from 'react-icons/bi'
import {AiOutlineCheck} from  'react-icons/ai'

function Content(props) {
    return (
        <div class = "container-fluid" >
           <Box  backgroundColor="#f7f7f7"
              // height={{
              //   base: "1200px", // 0-48em
              //   md: "649px", // 48em-80em,
              //   xl: "700px", // 80em+
              // }}
              padding="20px"
              width={{ base: "100%", md: "100%", xl: "95%" }}
              borderWidth="2px"px
              marginStart = "20px"
              borderRadius="lg"
              shadow="2xl">
                  <HStack>
                        <Icon fontSize = "28px" as = {BiErrorCircle} />
                        <Text fontSize = "24px">Issues</Text>
                        <Box backgroundColor = "#E4EBF4" borderRadius = "30px" padding = "4px">
                        <Text  fontSize = "16px">{props.issuesL}</Text>
                        </Box>
                  </HStack>

                 <Box   backgroundColor="#E4EBF4"
                        borderRadius="20px"
                        shadow="xl"
                        padding={5}
                        marginTop = "20px">
                        <Tabs variant="enclosed">
                            <TabList>
                                <Tabs><HStack> <Icon fontSize = "20px" as = {BiErrorCircle} /> <Text fontSize = "20px">Open</Text> </HStack></Tabs>
                                <Tabs><HStack> <Icon  fontSize = "20px" as = {AiOutlineCheck} /> <Text fontSize = "20px">Closed</Text></HStack> </Tabs>
                            </TabList>
                            <TabPanels>
                                <TabPanel>

                                </TabPanel>
                                <TabPanel>

                                </TabPanel>
                            </TabPanels>
                        </Tabs>
                 </Box>

           </Box>
        </div>
    );
}

export default Content;
